import logo from './logo.svg';
import './App.css';
import FirstTabs from './dashboard/FirstTabs.js'
import facebookIcon from './images/icon-facebook.svg'
import instagramIcon from '../src/images/icon-insta'
import twitterIcon from './images/icon-twitter.svg'
import youtubeIcon from './images/icon-youtube.svg'

const firstTabs = [{
  icon: <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20"><path fill="#178FF5" d="M18.896 0H1.104C.494 0 0 .494 0 1.104v17.793C0 19.506.494 20 1.104 20h9.58v-7.745H8.076V9.237h2.606V7.01c0-2.583 1.578-3.99 3.883-3.99 1.104 0 2.052.082 2.329.119v2.7h-1.598c-1.254 0-1.496.597-1.496 1.47v1.928h2.989l-.39 3.018h-2.6V20h5.098c.608 0 1.102-.494 1.102-1.104V1.104C20 .494 19.506 0 18.896 0z"/></svg>,
  user: '@nathanf',
  number: '1987',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '12 Today',
},
{
  icon: twitterIcon,
  user: '@nathanf',
  number: '1044',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '99 Today',
},
{
  icon: instagramIcon,
  user: '@realnathanf',
  number: '11k',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '1099 Today',
},
{
  icon: youtubeIcon,
  user: 'Nathan F.',
  number: '8239',
  type: 'Subscribers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#DC414C" fill-rule="evenodd" d="M0 0l4 4 4-4z"/></svg>,
  isEnough: false,
  howMany: '144 Today',
}]

function App() {
  return (
    <div className="App">
      <FirstTabs tabList={firstTabs}/>
    </div>
  );
}

export default App;
